import React from 'react';
import {Message} from 'Domain/Message';

interface Props {
    message: Message
}

function MessageList(): JSX.Element {
    const messages: Message[] = [
        {
            id: '1',
            name: 'Tobi',
            content: 'Hallo, wir wollen Kölsch.',
            timestamp: 10102020
        },
        {
            id: '2',
            name: 'Thorsten',
            content: 'Moin aus Dürscheid.',
            timestamp: 16012020
        },
        {
            id: '3',
            name: 'Robert',
            content: 'EffZeh kann nix',
            timestamp: 24032020
        }
    ];

    return (
        <ul>
            {messages.map(message => (
                <li key={message.id}>{message.name}:{message.content}</li>
            ))}
        </ul>
    )
}

export default MessageList;
